  false,\n\t\"url\": null,\n\t\"notes\": \"Final report for a project at Charles M.
  Russell National Wildlife Refuge (CMR) to GIS map refuge pasture boundaries and
  applying historic domestic livestock use to accurately assess the overall grazing/browsing
  use of Refuge habitats.  Once the pasture GIS layers have been completed, grazing
  history over time will be linked in GIS to each grazing unit. Having a complete
  understanding of past livestock grazing intensities will be the foundation for understanding
  habitat changes resulting from past management actions.\",\n\t\"license_title\":
